import React from 'react';
import './App.css';
import Login from './component/Login';
import { library } from '@fortawesome/fontawesome-svg-core';
import { faEye, faEyeSlash } from '@fortawesome/free-solid-svg-icons';
library.add(faEye, faEyeSlash);

function App() {
  return (
    <div className="App">
      <Login/>
    </div>
  );
}

export default App;
